  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"mysql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// Administration entity - manages the platform\nmodel Administration {\n  id        Int      @id @default(autoincrement())\n  username  String   @unique\n  email     String   @unique\n  password  String\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"administrations\")\n}\n\n// Company entity - partner companies that post offers\nmodel Company {\n  id          Int      @id @default(autoincrement())\n  name        String\n  email       String   @unique\n  password    String\n  sector      String\n  description String?  @db.Text\n  isApproved  Boolean  @default(false)\n  logoPath    String?\n  website     String?\n  phone       String?\n  address     String?\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  offers Offer[]\n\n  @@map(\"companies\")\n}\n\n// Student entity - students who apply for offers\nmodel Student {\n  id         Int      @id @default(autoincrement())\n  firstName  String\n  lastName   String\n  email      String   @unique\n  password   String\n  studyLevel String // e.g., \"1st Year\", \"2nd Year\", \"3rd Year\", \"Master 1\", \"Master 2\"\n  groupName  String // e.g., \"GL1\", \"RT2\", \"TIC3\"\n  cvPath     String?\n  skills     String?  @db.Text // Comma-separated skills\n  phone      String?\n  linkedin   String?\n  github     String?\n  avatarPath String?\n  createdAt  DateTime @default(now())\n  updatedAt  DateTime @updatedAt\n\n  // Relations\n  applications Application[]\n\n  @@map(\"students\")\n}\n\n// Offer entity - job/internship offers posted by companies\nmodel Offer {\n  id           Int           @id @default(autoincrement())\n  title        String\n  category     OfferCategory\n  description  String        @db.Text\n  requirements String?       @db.Text\n  location     String?\n  duration     String? // e.g., \"3 months\", \"6 months\"\n  startDate    DateTime?\n  salary       String?\n  status       OfferStatus   @default(ACTIVE)\n  postedDate   DateTime      @default(now())\n  deadline     DateTime?\n  updatedAt    DateTime      @updatedAt\n\n  // Relations\n  companyId    Int\n  company      Company       @relation(fields: [companyId], references: [id], onDelete: Cascade)\n  applications Application[]\n\n  @@map(\"offers\")\n}\n\n// Application entity - student applications to offers\nmodel Application {\n  id              Int               @id @default(autoincrement())\n  applicationDate DateTime          @default(now())\n  status          ApplicationStatus @default(PENDING)\n  coverLetter     String?           @db.Text\n  cvPath          String? // Override student's default CV if provided\n  updatedAt       DateTime          @updatedAt\n\n  // Relations\n  studentId Int\n  student   Student @relation(fields: [studentId], references: [id], onDelete: Cascade)\n  offerId   Int\n  offer     Offer   @relation(fields: [offerId], references: [id], onDelete: Cascade)\n\n  @@unique([studentId, offerId]) // A student can only apply once per offer\n  @@map(\"applications\")\n}\n\n// Enums\nenum OfferCategory {\n  PFE // Projet de Fin d'Etudes\n  SUMMER_INTERNSHIP\n  JOB\n}\n\nenum OfferStatus {\n  ACTIVE\n  CLOSED\n  DRAFT\n}\n\nenum ApplicationStatus {\n  PENDING\n  ACCEPTED\n  REJECTED\n}\n",
